    <div id=\"introduction\" class=\"cards-1\">
        <div class=\"container\">
            <div class=\"row\">
                <div class=\"col-lg-12\">
                    <h1>Modifier une fiche frais</h1>
                    {{ form_start(form) }}
                        <style>
                            br{
                                line-height: 20px;
                            }
                        </style>
                        <table>
                            <tr>{{ form_row(form.id) }}</tr><br/>
                            <tr>{{ form_row(form.mois) }}</tr><br/>
                            <tr>{{ form_row(form.nbjustificatifs) }}</tr><br/>
                            <tr>{{ form_row(form.montantvalide) }}</tr><br/>
                            <tr>{{ form_row(form.datemodif)}}</tr><br/>
                            <tr>{{ form_row(form.idetat) }}</tr><br/>
                            <tr>{{ form_row(form.idutilisateur) }}</tr>
                            <br/>
                        </table>
                        <button style=\"background-color: #7dc22b;\" class=\"btn\">{{ button_label|default('Valider') }}</button>
                        <button style='background-color: #7dc22b; border-color: #7dc22b' class=\"btn\"><a href=\"{{ path('crud_etat_index') }}\">Voir la liste des états</a></button><br>
                    {{ form_end(form) }}
                    
                   
                </div>
            </div>
        </div>
    </div>
{% endblock %}
